// Import all SVGs
import MonsteraSeed from '../assets/seeds/monstera-seed.svg';
import SnapdragonSeed from '../assets/seeds/snapdragon-seed.svg';
import TulipSeed from '../assets/seeds/tulip-seed.svg';
import LilySeed from '../assets/seeds/lily-seed.svg';

import MonsteraStage1 from '../assets/plants/monstera/stage1.svg';
import MonsteraStage2 from '../assets/plants/monstera/stage2.svg';
import MonsteraStage3 from '../assets/plants/monstera/stage3.svg';
import MonsteraStage4 from '../assets/plants/monstera/stage4.svg';

import SnapdragonStage1 from '../assets/plants/snapdragon/stage1.svg';
import SnapdragonStage2 from '../assets/plants/snapdragon/stage2.svg';
import SnapdragonStage3 from '../assets/plants/snapdragon/stage3.svg';
import SnapdragonStage4 from '../assets/plants/snapdragon/stage4.svg';

import TulipStage1 from '../assets/plants/tulip/stage1.svg';
import TulipStage2 from '../assets/plants/tulip/stage2.svg';
import TulipStage3 from '../assets/plants/tulip/stage3.svg';
import TulipStage4 from '../assets/plants/tulip/stage4.svg';

import LilyStage1 from '../assets/plants/lily/stage1.svg';
import LilyStage2 from '../assets/plants/lily/stage2.svg';
import LilyStage3 from '../assets/plants/lily/stage3.svg';
import LilyStage4 from '../assets/plants/lily/stage4.svg';

import Pot from '../assets/pot.svg';
import WateringCan from '../assets/watering-can.svg';
import IntroPlant from '../assets/intro-plant.svg';

export const seeds = {
  monstera: MonsteraSeed,
  snapdragon: SnapdragonSeed,
  tulip: TulipSeed,
  lily: LilySeed
};

export const plantStages = {
  monstera: [MonsteraStage1, MonsteraStage2, MonsteraStage3, MonsteraStage4],
  snapdragon: [SnapdragonStage1, SnapdragonStage2, SnapdragonStage3, SnapdragonStage4],
  tulip: [TulipStage1, TulipStage2, TulipStage3, TulipStage4],
  lily: [LilyStage1, LilyStage2, LilyStage3, LilyStage4]
};

export { Pot, WateringCan, IntroPlant };
